%POSE3DSOLVER_6PT_NONSYM Refractive pose + focal length solver, 6 points (non-minimal)
%	v = POSE3DSOLVER_6PT_NONSYM(X,x) solves for the
%	rotation, focal length and x- and y-translation of a camera observing six
%	points with projections x through one or several parallel refractive planes
%	with normal vector [0 0 1]'.
%	The rotation is returned as a unit-length quaternion Q and v = [f; Q; tx; ty].
%
%	POSE3DSOLVER_6PT_NONSYM(...,'newton',k) refines the solutions with k Newton
%	steps.
%
%	POSE3DSOLVER_6PT_NONSYM(...,'check_tol',tol) filters solutions with absolute
%	tolerance tol.
%
%	POSE3DSOLVER_6PT_NONSYM(...,'act_var',{1}) uses the specified action
%	variable (q1).
%
%	POSE3DSOLVER_6PT_NONSYM(...,'r',r) solves for the z-translation assuming that
%	the refractive plane is z = 0 and the ratio of refractive indices n1/n2
%	is r.
function v = pose3dsolver_6pt_nonsym(X,x,varargin)

newton_steps = 0;
check_tol = 1e-3;
act_var = 1;
r = [];

for i=1:2:length(varargin)
	switch varargin{i}
		case 'newton', newton_steps = varargin{i+1};
		case 'check_tol', check_tol = varargin{i+1};
		case 'act_var', act_var = varargin{i+1};
		case 'r', r = varargin{i+1};
		otherwise, error('Parameter parse error');
	end
end

u = bsxfun(@rdivide,x,sqrt(sum(x.^2,1)));

% Randomly rotate coordinate system to hopefully avoid the 180 deg.
% singularity
theta = (2*rand-1)*pi;
c = cos(theta); s = sin(theta);
R = [c -s 0; s c 0; 0 0 1];
Xt = R'*X;


% Generate equation coefficients
coeff1 = eqcoeff(u(:,1),Xt(:,1));
coeff2 = eqcoeff(u(:,2),Xt(:,2));
coeff3 = eqcoeff(u(:,3),Xt(:,3));
coeff4 = eqcoeff(u(:,4),Xt(:,4));
coeff5 = eqcoeff(u(:,5),Xt(:,5));
coeff6 = eqcoeff(u(:,6),Xt(:,6));
coeff = [coeff1 coeff2 coeff3 coeff4 coeff5 coeff6];


switch act_var
	case 1
		A = eqmat_x1(coeff);
	otherwise
		error('act_var should be in {1}');
end

[v,~] = eig(A);

% v = [f q2 q3 q4 tx ty]
v = bsxfun(@rdivide,v(end-6:end-1,:),v(end,:)); % Divide by constant term

% Throw away obviously complex or inf/nan solutions
v = real(v(:,max(abs(imag(v)))<1e-4 & all(isfinite(v))));

% Check in the equations
keep = true(1,size(v,2));
for i=1:size(v,2)
	if max(abs(solvedeq(u,Xt,v(:,i))))>check_tol
		keep(i) = false;
	end
end
v = v(:,keep);


% Take a few Newton steps to refine solutions
if newton_steps
	keep = true(1,size(v,2));
	for i=1:size(v,2)
		for j=1:newton_steps
			[f J] = eqjacandfun(u,Xt,v(:,i));
			v(:,i) = v(:,i) - J\f;
		end
		if max(abs(solvedeq(u,Xt,v(:,i))))>check_tol
			keep(i) = false;
		end
	end
	v = v(:,keep);
end

% Transform solution back to original coordinates
t = -tan(theta/2);
Q = [1-v(4,:)*t; v(2:3,:)+t*[v(3,:); -v(2,:)]; v(4,:)+t];
v = [v(1,:); bsxfun(@rdivide,Q,sqrt(sum(Q.^2))); R(1:2,1:2)*v(5:6,:)];


if ~isempty(r) % Assume refractive plane is z = 0
	for i=1:size(v,2)
		% Solve for z-translation using one point
		c = tz_coeffs(v(2:5,i),v(6:7,i),X(:,1),u(:,1),r^2,v(1,i));
		% There are two solutions. The solution closest to
		% the plane is the correct one.
		z = roots(c);
		[~,ind] = min(abs(z));
		v(8,i) = z(ind);
	end
end






function A = computeActionMatrix(C,dE,dR,dB,red_ia,red_ib,basis_ia,basis_ib)

% Eliminate excessive monomials and solve for reduction monomials
% [qc,r] = qr(C(:,1:dE),C(:,dE+1:end),0);
[qc,r,~] = qr(C(:,1:dE),C(:,dE+1:end),0);
% [q,r,~] = qr(full(C(:,1:dE)),0); qc = q'*C(:,dE+1:end);

red = all(abs(r)<1e-12,2);
% red = find(abs(r(:,dE))>1e-12,1,'last')+1:size(r,1);
% red = find(abs(diag(r))>1e-12,1,'last')+1:size(r,1);

CR2 = qc(red,1:dR);
CB2 = qc(red,dR+1:end);

% Basis 'cleaning' step
[~,r,p] = qr(full(CR2),'vector');
badR = abs(diag(r))<1e-10;
badR = p(badR); badR;

% This sparse matrix construction is just for convenient re-indexing
S = sparse([red_ib+dB basis_ib],[red_ia basis_ia],1);
S(badR+dB,:) = [];
badB = find(sum(S,1)==0);
S(:,badB) = [];
S(badB,:) = [];

CR2(:,badR) = [];
CB2(:,badB) = [];
T = -(CR2\CB2);

% Construct action matrix
dB = size(S,2);
A = zeros(dB);
for r=1:dB
	c = find(S(:,r));
	if c>dB
		A(r,:) = T(c-dB,:);
	else
		A(r,c) = 1;
	end
end




